import './App.css';

function Todo(){
	return(
		<React.Fragment>
        <TodoCounter/>
        <TodoSearch/>
        <CreateTodoButton/>
        <TodoList>
          {todos.map(todo => (
            <TodoItem key={todo.text} text={todo.text} value={todo.value} />
            ))}
        </TodoList>
    	</React.Fragment>
	);
}

